import React, { Component } from "react";
import "./App.css";
import Header from "./component/Header/Header";
import QuanLyNguoiDung from "./component/QuanLyNguoiDung/QuanLyNguoiDung";
import QuanLyGioHang from "./component/QuanLyGioHang/QuanLyGioHang";
import TrangChuContainer from "./containers/TrangChuContainer";
import { Route } from "react-router-dom";
import NotificationsNoneIcon from "@mui/icons-material/NotificationsNone";
import QuanLyNguoiDungContainer from "./containers/QuanLyNguoiDungContainer";
import { Link } from "react-router-dom";
import { withRouter } from "react-router-dom";
class App extends Component {
  componentDidMount() {
    fetch(`http://localhost:9000`, {
      method: "POST",
      mode: "cors",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        role: "admisn",
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        let { history } = this.props;
        if (data.statusCode !== 200) {
          window.location.href = `http://localhost:3001/`;
        }
      })
      .catch((err) => console.log(err));
  }
  render() {
    let route = [
      {
        path: "/",
        exact: true,
        component: <TrangChuContainer />,
      },
      {
        path: "/quanlynguoidung",
        exact: false,
        component: <QuanLyNguoiDungContainer />,
      },
      {
        path: "/quanlygiohang",
        exact: false,
        component: <QuanLyGioHang />,
      },
    ];

    return (
      <>
        <div class="container-children">
          <div className="containerxxx">
            <Link to="/" className="logo">
              đâsdsadasd
            </Link>
            <div className="menu">
              <NotificationsNoneIcon></NotificationsNoneIcon>
            </div>
          </div>
        </div>
        <div className="main">
          <div className="left">
            <Header />
          </div>
          <div className="right">
            {route.map((route, index) => {
              return (
                <Route key={index} path={route.path} exact={route.exact}>
                  {route.component}
                </Route>
              );
            })}
          </div>
        </div>
      </>
    );
  }
}
export default withRouter(App);
